import React from 'react';
import { Button } from 'antd';

const TaskList = ({ data }) => {
    return (
        <div style={{ padding: '20px' }}>
            <h2>Görevleriniz:</h2>
            {data && data.length > 0 ? (
                data.map((task, index) => (
                    <Button key={index} style={{ marginBottom: '10px' }} block>
                        {task}
                    </Button>
                ))
            ) : (
                <p>Görev bulunamadı.</p>
            )}
        </div>
    );
};

export default TaskList;
